import logo from './logo.svg';
import './App.css';
import Navigation from './components/navigation.mjs';

function App() {
  return (
    <div className="App">
        {/* <Navigation>
        </Navigation> */}
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <p>
            Edit <code>src/App.js</code> and save to reload.
          </p>
        </header>

    </div>
  );
}

export default App;
